      sourcesContent: ["import express from 'express';\r\nimport DB from './db.js';\r\nimport {router as ToDoRouter} from './routes.js';\r\n\r\nimport swaggerUi from 'swagger-ui-express';\r\nimport swaggerJsdoc from 'swagger-jsdoc';\r\nimport { swaggerOptions } from './swagger.js';\r\n\r\n\r\nimport cookieParser from 'cookie-parser';\r\nimport { getRandomValues } from 'crypto';\r\n\r\nimport passport from 'passport';\r\nimport { Strategy, ExtractJwt } from 'passport-jwt';\r\n\r\nconst PORT = process.env.PORT || 3000;\r\n\r\n\r\n\r\n\r\n/** Zentrales Objekt f\xFCr unsere Express-Applikation */\r\nconst app = express();\r\n\r\napp.use(cookieParser())\r\napp.use(express.static('../frontend'));\r\napp.use(express.json());\r\napp.use(ToDoRouter);\r\napp.use(passport.initialize());\r\n/** Middleware f\xFCr Swagger */\r\nconst swaggerDocs = swaggerJsdoc(swaggerOptions);\r\napp.use('/api-docs', swaggerUi.serve, swaggerUi.setup(swaggerDocs));\r\n\r\n\r\n\r\n/** global instance of our database */\r\nlet db = new DB();\r\n\r\n/** Initialize database connection */\r\nasync function initDB() {\r\n    await db.connect();\r\n    console.log(\"Connected to database\");\r\n}\r\n\r\n/** Middleware for authentication. \r\n * This middleware could be used to implement JWT-based authentication. Currently, this is only a stub.\r\n*/\r\n\r\nconst opts = {\r\n    jwtFromRequest: (req)=>\r\n    {\r\n        let token = ExtractJwt.fromAuthHeaderAsBearerToken()(req);\r\n        if (!token) {\r\n            if (req.cookies.token) {\r\n                token = req.cookies.token\r\n            }\r\n        }\r\n        return token\r\n    },\r\n    secretOrKey: `-----BEGIN PUBLIC KEY-----\r\\r\n-----END PUBLIC KEY-----`,\r\n    ignoreExpiration: true,\r\n    issuer: \"https://jupiter.fh-swf.de/keycloak/realms/webentwicklung\"\r\n};\r\n\r\npassport.use(\r\n    new Strategy(opts, (payload, done)=>{\r\n        return done(null, payload)\r\n    })\r\n)\r\n\r\n\r\nlet server;\r\nawait initDB()\r\n    .then(() => {\r\n        server = app.listen(PORT, () => {\r\n            console.log(`Server listening on port ${PORT}`);\r\n        })\r\n    })\r\n\r\nexport { app, server, db}\r\n"],
